.main {
  overflow: hidden;
  display: flex;
  flex-direction: column;
  padding: 0 0 10px;
  .JNPF-common-search-box {
    border-bottom: 1px solid #dcdfe6;
  }
  >>> .el-table {
    flex: 1;
    border-top: none;
  }
  >>> .tips-item {
    display: none;
  }
  >>> .flow-container {
    display: inline-block;
    background: #fff;
    width: 100%;
    -webkit-box-sizing: border-box;
    box-sizing: border-box;
    text-align: center;
    overflow: auto;
    margin-top: 30px;
  }
  >>> .tips {
    position: absolute;
    left: 9px;
    top: -1px;
    z-index: 199;
    text-align: left;
  }
  >>> .scale-slider {
    position: fixed;
    right: 10px;
    z-index: 199;
    margin-top: -20px;
  }
}
.flow-text {
  font-size: 18px;
}
